import React from 'react';
import { Page, Text, View, Document, StyleSheet, BlobProvider } from '@react-pdf/renderer';

// Create styles
const newstyles = StyleSheet.create({
  page: {
    flexDirection: 'row',
    backgroundColor: '#bff044'
  },
  section: {
    margin: 10,
    padding: 10,
    flexGrow: 1
  },
  title: {
    fontFamily: 'Lato Bold',
    fontSize: 14,
    marginBottom: 10,
    textTransform: 'uppercase',
  },
});

// Create Document Component
const MyDocument =(
  <Document>
    <Page size="A4" style={newstyles.page}>
      <View style={newstyles.section}>
        <Text style={newstyles.title}>Este es un texto cualquiera</Text>
      </View>
    </Page>
  </Document>)

const PDF = () => {
    return (
      <BlobProvider document={MyDocument}>
        {({ url }) => (
          <a href={url} target="_blank">Previsualizar</a>
        )}
      </BlobProvider>
    );
  };

export default PDF;
